B.N6=new A.b2('Poor posture causes certain muscles of our body to remain \u201con\u201d and active during the day. Many people who develop back pain assume postures that don\u2019t allow their low back muscles to relax.If this is you, try to change your posture right now by using the cue to "stand tall" or "stand like a military officer"  and see how that affects your low back stiffness. Brace your core slightly, squeeze your glutes and try to stand with "perfect posture." Did anything change? The goal is to teach your body a new way to stand that is pain free and alleviates tension in your body. If changing the way you stand already modified your pain levels, you have found a way to modify and wind-down your symptoms!',null,null,null,null,null,null,null)
