B.N8=new A.b2("Often those who have pain while sitting in the bottom position of a squat do so because they have a posterior pelvic tilt (butt wink) that created an excessive round in the low back.  During the descent of the squat the thigh bone (femur) rotates in the hip socket (called the acetabulum). As the depth of the squat increases, the femur can eventually come into contact with the front rim of the socket. The timing of this contact will depend on the size of the femur and the depth of the socket (something we can thank our parents for). Because the femur can no longer rotate at this point, the pelvis must reflexively rotate backwards in order to continue the descent of the squat which then brings the low back into a rounded position as well.",null,null,null,null,null,null,null)
B.Nc=new A.b2("Start by standing in your normal posture as if you\u2019re waiting in line at a grocery store. Have a friend take a photo of you from the side, front and from the back. What do you notice about your standing posture? Are your shoulders rounded? Is your chin poking out in front of your body? Is your low back flat or does it have an excessive arch?  Do you feel certain muscles of your back flexing or contracting hard?",null,null,null,null,null,null,null)
B.Ne=new A.b2("Assessments",null,B.kR,null,null,null,null,null)
B.Ng=new A.b2("On To Assessemnt",null,null,null,null,null,null,null)
B.Nh=new A.b2("Is having butt wink automatically a sign of impending back pain? Not necessarily. However, if the motion happens to a great degree under load and/or occurs enough times during the squat, the potential to create a back injury greatly increases.",null,null,null,null,null,null,null)
B.Ni=new A.b2("Screening your back pain",null,B.kR,null,null,null,null,null)
B.Nj=new A.b2("To help give us an even better idea to the cause of your pain, we will now perform a few tests. Again the goal is to identify postures, motions and loads that trigger your pain and those that can be performed without. By pinpointing these problematic factors and making the invisible now visible, we can then work to decrease your symptoms and return to lifting pain free.",null,B.eP,null,null,null,null,null)
B.Nk=new A.b2('There is always a reason for back pain. It doesn\u2019t just appear out of thin air and it\u2019s not "all in your head." In order to fix and remove the pain, we need to find out why it started in the first place.',null,B.eP,null,null,null,null,null)
B.Nl=new A.b2("Next, pick up an unloaded barbell and hold it at your waist in the hang position. Let the barbell drop down to the middle of your shins as if you are performing an RDL (Romanian Deadlift). If you don\u2019t have a barbell, just mimic the motion by having your hands by your side.",null,null,null,null,null,null,null)
B.Nm=new A.b2("If you had pain during this test due to either reason, try to correct for your low back position by holding it in neutral by bracing your core and properly hinge from the hips. Don\u2019t let your low back arch or round as you go down and squeeze your glutes while driving your heels into the ground on the ascent. Does this result in a slight decrease in pain compared to the first time? If so, you need to learn how to properly hinge at the hips and limit excessive movement (either in flexion or extension) from your back!",null,null,null,null,null,null,null)
B.No=new A.b2("Hold this for a few seconds and then return to the start position. What did you experience? If you had pain during the motion of bending forward, it\u2019s means again you have a flexion problem. If however you didn\u2019t have pain while bending over, however had pain during the return movement it\u2019s a sign of having an extension issue. Athletes who have pain upon returning from this forward position frequently move from their low back first and THEN the hips (lumbar extension followed by hip extension).",null,null,null,null,null,null,null)
B.Np=new A.b2("Find a wall and kneel close to it with your shoes off. Use a tape measure and place your big toe 5 inches from the wall. From this position, push your knee forward attempting to touch the wall with your knee. Your heel must stay in contact with the ground.",null,null,null,null,null,null,null)
B.Nt=new A.b2("If this motion creates pain during the screening of the squat, you likely have a flexion intolerance problem. The presence of pain in this deep squat with a rounded back is clueing you that the position of your pelvis when lifting is a factor in creating your symptoms. Your first step is to be cognizant of how much butt wink your body has when squatting or dropping under a clean or snatch. The next step should be to also check out the mobility of your ankles.",null,null,null,null,null,null,null)
B.Nu=new A.b2("Back Pain : Deadlift Assessment",null,null,null,null,null,null,null)
