B.Nz=new A.b2("Why does ankle mobility matter when it comes to low back pain? When the ankle becomes stiff and immobile (particularly in the movement of dorsiflexion) the knee will be unable to push forward over the toes during the deepest portion of the squat. This means if you continue to descend into a deep squat, another part of your body (the pelvis and low back) has to give way and move excessively. In order to see if you ankle is part of the problem, were are going to try the five inch wall test",null,null,null,null,null,null,null)
